import React from 'react';
import Topbar from './components/topbar/Topbar'; 
import Sidebar from './components/sidebar/Sidebar';
import Home from './home/Home';
import "./app.css"

function App() {
  return (
    <div>
      <Topbar/>
      <div className="container">
        <Sidebar/>
        <Home/>
      </div>
    </div>
  );
}





export default App;
